description:
Sapphira A is preparing for a night out. She takes a final look in the mirror, grabs her handbag, and heads for the door. But then she hesitates, and that's the moment when &quot;Dance The Night Away&quot; veers from the prospect of a crowded dance floor in a noisy club to a far more private venue, and a much more intimate agenda.

